import React, { useState } from 'react';
import './App.css';

import Social from './components/Social';
import Carousel from './components/Carousel'
import Team from './components/Team';
import Partners from './components/Partners';
import Footer from './components/Footer';


const App = () => (
  <>
      <Carousel/>        
      <Social/>        
      <div class="jumbotron_second jumbotron-fluid pt-5">
      <div class="container">
        <h1 class="display-4">Line Stickers Comming Soon!</h1>
        <p class="lead">Get ready to post couple stickers to all your friends. High Res stickers comming soon.  Click the button below to learn more!</p>
        <p class="lead">
          <a class="btn btn-dark btn-lg" href="https://store.line.me/stickershop/product/20019319/en" role="button">Learn more</a>
        </p>
        </div>
      </div>
      <Team/>
      <Partners/>
      <Footer/>
  </>
);

export default App;
